  width: 104px;
  height: 58px;
  margin: 24px 128px 16px;
  object-fit: contain;
`
export const TextSingUp = styled.h1`
  width: 326px;
  height: 18px;
  font-family: Roboto;
  font-size: 20px;
  font-weight: normal;
  font-stretch: normal;
  font-style: normal;
  line-height: normal;
  letter-spacing: -0.39px;
  text-align: center;
  color: #000;
`
